SELECT bp.organisationId, t.serial_no, 
c.name as Kanal, s.name as Hizmet, s2.sector_name as Sektor,
COUNT(bp.id) as IslemAdet, SUM(bp.amount) as Ciro FROM odeal.BasePayment bp 
LEFT JOIN odeal.TerminalPayment tp ON tp.id = bp.id 
JOIN odeal.Terminal t ON t.id = tp.terminal_id 
LEFT JOIN odeal.Organisation o ON o.id = bp.organisationId
LEFT JOIN odeal.Sector s2 ON s2.id = o.sectorId
LEFT JOIN odeal.Channel c ON c.id = t.channelId
LEFT JOIN subscription.Service s ON s.id = bp.serviceId
WHERE bp.currentStatus = 6 AND bp.serviceId <> 3 AND bp.signedDate >= "2023-10-01 00:00:00" AND bp.signedDate <= "2023-10-31 23:59:59"
GROUP BY bp.organisationId, t.serial_no, c.name, s.name

SHOW INDEX FROM odeal.BasePayment bp WHERE Column_name = "bp.signedDate"

SELECT DATE_FORMAT(s.`start`,"%Y-%m"), t.organisation_id, t.serial_no, c.name, s.`start`, p.amount, LAST_DAY(s.`start`) as SonGun,
DAY(LAST_DAY(s.start)) as GunAdet, DATEDIFF(LAST_DAY(s.`start`),s.`start`) as FarkGun,
(p.amount/DAY(LAST_DAY(s.start)))*(DAY(LAST_DAY(s.start))-DATEDIFF(LAST_DAY(s.`start`),s.`start`)) as FaturaTutar FROM odeal.Terminal t 
JOIN subscription.Subscription s ON s.id = t.subscription_id 
JOIN subscription.Plan p ON p.id = s.planId
JOIN odeal.Organisation o ON o.id = t.organisation_id AND o.demo = 0
LEFT JOIN odeal.Channel c ON c.id = t.channelId 
WHERE t.terminalStatus = 1
GROUP BY DATE_FORMAT(s.`start`,"%Y-%m") , t.organisation_id , t.serial_no , c.name, s.`start` ,p.amount 

301121208	PAX710027771


SELECT MIN(sh.`_createdDate`) FROM subscription.SubscriptionHistory sh 
WHERE sh.subscriptionId = 72422

SELECT DATE_FORMAT(sh.currentPeriodStart, "%Y-%m") as Ay, t.organisation_id, t.serial_no, sh.subscriptionId, 
sh.currentPeriodStart, sh.currentPeriodEnd, DATEDIFF(sh.currentPeriodEnd,sh.currentPeriodStart) as Fark, 
DAY(sh.currentPeriodEnd) as AyinGunu, (DATEDIFF(sh.currentPeriodEnd,sh.currentPeriodStart)*(p.amount/DAY(sh.currentPeriodEnd))) as AbonelikBedeli,  sh.planId, p.amount FROM odeal.Terminal t 
LEFT JOIN subscription.SubscriptionHistory sh ON sh.subscriptionId = t.subscription_id AND t.id = sh.terminalId
LEFT JOIN subscription.Plan p ON p.id = sh.planId
JOIN odeal.Organisation o ON o.id = t.organisation_id AND o.demo = 0
LEFT JOIN odeal.Channel c ON c.id = t.channelId 
WHERE t.terminalStatus = 1
GROUP BY DATE_FORMAT(sh.currentPeriodStart, "%Y-%m"), t.organisation_id, t.serial_no, 
sh.subscriptionId, sh.currentPeriodStart, sh.currentPeriodEnd, sh.planId, p.amount

SELECT c.name, COUNT(t.serial_no) FROM odeal.Terminal t 
LEFT JOIN odeal.Channel c ON c.id = t.channelId
WHERE c.id IS NOT NULL
GROUP BY c.name

SELECT o.id, t.serial_no, tp.installment, br.id, br.transaction_date, br.installment,
bp.id, bp.appliedRate, bp.amount,
IF(tp.installment=br.installment,"EŞİT","FARKLI") as TaksitDurum, IF(ISNULL(br.id),"YOK","VAR") as BRDurum FROM odeal.Organisation o 
JOIN odeal.Terminal t ON t.organisation_id = o.id
JOIN odeal.TerminalPayment tp ON tp.terminal_id = t.id 
JOIN odeal.BasePayment bp ON bp.id = tp.id 
LEFT JOIN paymatch.bank_report br ON br.unique_key = bp.uniqueKey
